using namespace std;
struct Trie { // 构建字典树结构
	bool isEnd;
	vector<Trie *> children;
	Trie()
	{
		this->children = vector<Trie *>(26, nullptr);
		this->isEnd = false;
	}
};

class Solution {
    private:
	Trie *trie = new Trie();
	void insert(const string &word)
	{ // 往字典树插入单词
		Trie *node = trie;
		for (char ch : word) {
			int idx = ch - 'a';
			if (node->children[idx] == nullptr) {
				node->children[idx] = new Trie();
			}
			node = node->children[idx];
		}
		node->isEnd = true;
	}
	bool dfs(const string &word, int start)
	{ // DFS遍历
		if (start == (int)word.size())
			return true;
		Trie *node = trie;
		for (int i = start; i < (int)word.size(); i++) {
			char ch = word[i];
			int idx = ch - 'a';
			node = node->children[idx];
			if (node == nullptr)
				return false;
			if (node->isEnd) {
				if (dfs(word, i + 1))
					return true;
			}
		}
		return false;
	}

    public:
	vector<string> findAllConcatenatedWordsInADict(vector<string> &words)
	{
		vector<string> ans;
		auto cmp = [&](const string &a, const string &b) {
			return a.size() < b.size();
		};
		sort(words.begin(), words.end(), cmp);
		for (string &word : words) {
			if (word.empty())
				continue;
			if (dfs(word, 0))
				ans.push_back(word);
			else
				insert(word);
		}
		return ans;
	}
};

